import React from 'react';
import Card from './Card';
import sdata from './Sdata';

function App() {
  console.log(sdata);
  return (
    <>
      <h1>Hello This is Shyam</h1>
      {sdata.map((val) => {
        // Ham basically HTML ke ander map method call kara rahr hai isliye hamne map method waale all code ko curly brack ke ander lika hai.

        return (
          <Card
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link}
          />
        );
      })}
    </>
  );
}

export default App;
